const Note = ({id, text, date, handleDeleteNote}) => {
    return (
        <div className="note">
            <span>{text}</span>
            <div className="note-footer">
                <small>{date}</small>
                <button className="delete-note" onClick={() => handleDeleteNote(id)}>Delete</button>
            </div>
        </div>
    )
};

export default Note;
